import React, { Component } from 'react';
import { BrowserRouter as Router, Link, Routes, Route, useNavigate } from 'react-router-dom';
import Posts from './Blog/Posts';
import CreatePost from './Blog/CreatePost';
import About from './AboutUs/AboutPage';
import Contact from './ContactUs/Contact';

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      currentRoute: 'Home', // Default header text
    };
  }

  handleRouteChange = (route) => {
    this.setState({ currentRoute: route });
  };

  render() {
    const { username } = this.props;
    const handleLogin = () => {
      if (username&&password) {
          onLogin(username);
      }else{
          alert('')
      };
  }

    return (
      <Router>
        <div>
          <nav className="navbar fixed-top navbar-expand-lg navbar-dark bg-dark">
            <div className="container">
              <a className="navbar-brand">Latchet</a>
              <button
                className="navbar-toggler"
                type="button"
                data-bs-toggle="collapse"
                data-bs-target="#navbarSupportedContent"
                aria-controls="navbarSupportedContent"
                aria-expanded="false"
                aria-label="Toggle navigation"
              >
                <span className="navbar-toggler-icon"></span>
              </button>
              <div className="collapse navbar-collapse" id="navbarSupportedContent">
                <ul className="navbar-nav ms-auto mb-2 mb-lg-0">
                  <li className="nav-item">
                    <Link
                      to="/posts"
                      className="nav-link"
                      onClick={() => this.handleRouteChange('Posts')}
                    >
                      Posts
                    </Link>
                  </li>
                  <li className="nav-item">
                    <Link
                      to="/create-post"
                      className="nav-link"
                      onClick={() => this.handleRouteChange('Create Post')}
                    >
                      Create Post
                    </Link>
                  </li>
                  <li className="nav-item">
                    <Link
                      to="/about-us"
                      className="nav-link"
                      onClick={() => this.handleRouteChange('About Us')}
                    >
                      About Us
                    </Link>
                  </li>
                  <li className="nav-item">
                    <Link
                      to="/contact"
                      className="nav-link"
                      onClick={() => this.handleRouteChange('Contact')}
                    >
                      Contact
                    </Link>
                  </li>
                  <li className="nav-item"><Link className="nav-divider">&nbsp;&nbsp;|&nbsp;&nbsp;</Link></li>
                  <li className="nav-item">
                    <Link
                      className="nav-link" Link to="/login" onClick={handleLogin}
                    >
                      Log Out
                    </Link>
                  </li>
                </ul>
              </div>
            </div>
          </nav>
        </div>

        <div>
        <header class="header py-5 mb-4">
            <div class="container">
                <div class="text-center my-5">
                    <h1 class="fw-bolder">{this.state.currentRoute}</h1>
                </div>
            </div>
        </header>
          <Routes>
            <Route exact path="/posts" element={<Posts />} />
            <Route exact path="/create-post" element={<CreatePost />} />
            <Route exact path="/about-us" element={<About />} />
            <Route exact path="/contact" element={<Contact />} />
          </Routes>
        </div>
      </Router>
    );
  }
}

export default App;
